        address to;
        bool unwrapBento;
        uint256 minAmount;
    }

    struct ComplexPathParams {
        InitialPath[] initialPath;
        PercentagePath[] percentagePath;
        Output[] output;
    }
}","keccak256":"0x5e0306888105bcc5834fbeff6cb469ad1eb3ebd768663b5b6656f5b80853aa4c","license":"GPL-3.0-or-later"},"contracts/interfaces/trident/ITridentSwapAdapter.sol":{"content":"// SPDX-License-Identifier: GPL-3.0-or-later

